&_nc_ohc=fSj_0mRZ2Y4AX8Lqz7D&oh=b8ab2cd440812473afd5fcb0ca599ae6&oe=5F7CEAC1";}i:203;a:1:{s:4:"type";s:5:"image";}i:204;a:1:{s:8:"owner_id";i:35395482257;}i:205;a:1:{s:14:"owner_username";s:0:"";}i:206;a:1:{s:14:"owner_fullname";s:0:"";}i:207;a:1:{s:9:"owner_pic";s:0:"";}i:208;a:1:{s:2:"id";s:19:"2391220162893603318";}i:209;a:1:{s:10:"short_code";s:11:"CEvUhGlBmH2";}i:210;a:1:{s:12:"created_time";i:1599275678;}i:211;a:1:{s:7:"caption";s:1071:"I had a very authentic smile on my face the past few days; when the last few weeks have proven to be especially heavy-hearted and it felt as if was nearing a broken mind, it seemed only fitting I take a photo to recall to myself, the pendulum always swings. I could only feel slumped in darkness for so long before an inevitable upswing. 

This should serve as a reminder life is a series of taking the good with the bad, and vice versa; a regression to the means, all sensations are temporary, and eventually you come back to center. 

Good and beautiful things are on the horizon. I have so much magic ready to explode from my chest and translate into so many pivotal developments. 

If you are struggling with your mental health, please lean on your loved ones, or Hell, shoot me a DM. I will hear and see anyone who feels isolated (or overwhelmed) during, arguably, the most intensely difficult time for all of us as a collective. 

As always, I love and accept me as I love and accept you. Xoxo. 

